import React from 'react'
import Card from './Card'
import "./Main.css"
import { useNavigate } from 'react-router-dom'


function Main(props) {

    let ProductData = props.ProductData
    let navigate = useNavigate()
    console.log(ProductData, "Data came from Home")

    function openProduct(prod) {
        navigate("/product", { state: prod })
        console.log(prod, "data for prod")
    }

    return (
        // <div className="mainBodyGrid">

        <div className="mainGridBody">
            {ProductData.map((prod, index) => (
                <>
                    <div className="clickProduct product" onClick={() => { openProduct(prod) }} >
                        <Card
                            key={index}
                            imgSrc={prod.thumbnail}
                            title={prod.name}
                            price={prod.price}
                            desc={prod.description}
                            rate={prod.rate}
                            brand={prod.brand}
                            market={prod.compare}
                            category={prod.category}
                            subCategory={prod.subCategory}
                        />
                    </div >
                </>
            ))
            }

        </div>
        // </div>
    )
}

export default Main
